import React, { Component } from 'react';


class Project extends Component {
  constructor(props) {
    super(props);
    
    this.state = {
      email: '',
      password: ''
    };
  }

  
  render() {
   
      let styles = {
        margin: '20px',
        width: '250px',
        height: '250px',
        backgroundColor: "yellow",
      };
    return (
        <div className="container">
            <div className="row justify-content-md-center">
       <div  style={{backgroundColor: "lightblue"}} className="col-md-12 " style={{height: 200}}>
       <h1>{this.props.title}</h1>
    <p>{this.props.text}</p>
    
 </div>
 </div>
 </div>
    );
  }
}
export default Project;
